  input: 'TEXT,F3A,,"In response to an FEC letter dated 11/07/2006, this report has
    been amended to itemize both reimbursement vendors and payroll recipients in the
    memo section.  To the best of our knowledge, all itemizations are complete and
    any reimbursements lacking a memo did not require itemization.  In addition, all
    best efforts regarding donor information have been updated to reflect our current
    data.  In response to two particular information requests, the campaign notes
    the following:  First, Mr. Salman Waheeduddin made three separate contributions
    on 08/28/2006 ($50, $100, $950) totaling $1,100 for that day.  Because the campaign
    interpreted this as an $1,100 contribution for the day, a 48-Hour Report was filed.  However,
    because the FECFile software lists multiple contributions in order of denomination,
    only the third, $950, contribution for that day was itemized in the October Quarterly
    Report.  Second, this campaign inadvertently failed to file a 48-Hour Report for
    a $2,500 contribution from the American Postal Workers Union on 09/09/2006.  The
    contribution is accurately reflected in the October Quarterly Report.  We apologize
    for this lapse and have improved our procedures to ensure that this does not happen
    again."'
